import React from 'react';
import pdfjs from 'pdfjs-dist/build/pdf';

import '../style.css';

/**
 * 项目中是发起Ajax请求，后台传回一个Base64编码的二进制image/jpeg 类型的pdf文件内容
 * 而且是多页文件
 * https://base64.guru/converter/encode/pdf
 * https://resources.jetbrains.com/storage/products/webstorm/docs/WebStorm_ReferenceCard.pdf
 * 用pdf to Base64 将2页的pdf转为 Base64
 * 模仿天宇页面，根据请求得到的Base64字符串内容，分页显示pdf
 */

/**
 *
 */
pdfjs.GlobalWorkerOptions.workerSrc = '/pdf.worker.min.js';

const pdfData = atob(
    '');

class HelloBase64 extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            pageNum: null
        };

    }

    /**
     * 在获得pdf文件页数后
     * 生成canvas元素数组
     * @param number
     */
    renderCanvas(number) {
        if (number == null) {
            return null;
        }
        const array = [];
        for (let i = 0; i < number; i++) {
            array.push(<canvas id={`canvas-${i+1}`}></canvas>
            );
        }
        return array;
    }

    /**
     * 渲染单页pdf
     * @param pdf 整个所有页的pdf二进制内容
     * @param num 当前要渲染的页码
     */
    renderPage(pdf, num) {
        pdf.getPage(num).then(function (page) {
           let scale = 2;
           let viewport = page.getViewport({scale: scale});
            // Prepare canvas using PDF page dimensions.
           let canvas = document.getElementById(`canvas-${num}`);
            let context = canvas.getContext('2d');
            canvas.height = viewport.height;
            canvas.width = viewport.width;
            // Render PDF page into canvas context.
            let renderContext = {
              canvasContext: context,
              viewport: viewport
            };
            page.render(renderContext);
        });
    }

    componentDidMount() {
        // Opening PDF by passing its binary data as a string. It is still preferable
        // to use Uint8Array, but string or array-like structure will work too.
        const loadingTask = pdfjs.getDocument({ data: pdfData, });
        const _this = this;
        loadingTask.promise.then(function(pdf) {
            // debugger;
            _this.setState({
                pageNum: pdf.numPages
            }, () => {
                for (let i = 0; i < _this.state.pageNum; i++) {
                    _this.renderPage(pdf, i + 1);
                }
            });
        });

    }

    render() {
        return (
            <div id="container">
                <h1>Hello, Base64 pdf! - test 4</h1>
                <div className="pdf">
                    {this.renderCanvas(this.state.pageNum)}
                </div>
            </div>
        );
    }
}

export default HelloBase64;